script: |
  super -f text -I q133.spq | sort > q133.out

inputs:
  - name: q133.spq
    data: |
      SELECT a+b*2
      FROM t1 (FORMAT parquet)
      WHERE a>b
      OR e+d BETWEEN a+b-10 AND c+130
      ORDER BY 1;
  - name: t1

